import React from 'react';
import item from '../images/box.svg';
//import Image from 'react-svg-loader!../images/box.svg';
//import Image2 from '../images/logo.svg';
//https://github.com/boopathi/react-svg-loader/tree/master/packages/react-svg-loader

class GallaryPanel extends React.Component {
  render() {

    const styles={
      width: "90%",
      margin: "10px auto",
      height:"500px",
      border: "solid 2px #F0F0F0",
      overflow: "scroll",
      display: "flex",
      flexWrap: "wrap",
      justifyContent: "space-around",
    };

    const style_input={
      width: "90%",
      padding: "5px 0",
      margin: "10px 0",
      border: "solid 2px #E7E7E7",
      fontWeight: "bold"
    }

    const i={
      border: "solid 1px #E7E7E7",
      height:"200px",
      flexBasis: "48%",
      marginTop: "5px"
    }

    return (
      <section className="section-gallalypanel section-bottom">
       <input style={style_input} type="search" placeholder="looking for..."/>
       <div className="gallaryframe" style={styles}>
         <img style={i} className="svg-item" src={item} alt=""/>
         <svg style={i}><path className="main" d="M168.68,59.078l-70.627,40.776l-0,81.553l70.627,-40.776l-0,-81.553Z"/><path d="M98.043,18.295l-70.627,40.777l70.637,40.782l70.627,-40.777l-70.637,-40.782Z" className="sub"/><path d="M98.053,99.854l-70.66,-40.795l0,81.548l70.66,40.796l-0,-81.549Z" className="accent"/></svg>
       </div>
      </section>
    );

}
}

export default GallaryPanel;
